import Router from "vue-router";
import Home from "@/views/home/Index";
import Login from "@/views/login/Index";


export default new Router({
  routes: [
    {
      path: "/",
      name: "Home",
      component: Home
    },
    {
      path: "/login",
      name: "Login",
      component: Login
    },
  ]
});
